import React from 'react';
import logo from './logo.svg';
// import './App.css';

function App() {
  return (
    <div className="app-content content">
    <div className="content-overlay" />
    <div className="content-wrapper">
      <div className="content-header row">
      </div>
      <div className="content-body">
        {/* error 404 */}
        <section className="row flexbox-container">
          <div className="col-xl-6 col-md-7 col-9">
            <div className="card bg-transparent shadow-none">
              <div className="card-content">
                <div className="card-body text-center bg-transparent miscellaneous">
                  <h1 className="error-title">Page Not Found :(</h1>
                  <p className="pb-3">
                    we couldn't find the page you are looking for</p>
                  <img className="img-fluid" src="./client/assets/images/pages/404.png" alt="404 error" />
                  <a href="index.html" className="btn btn-primary round glow mt-3">BACK
                    TO
                    HOME</a>
                </div>
              </div>
            </div>
          </div>
        </section>
        {/* error 404 end */}
      </div>
    </div>
  </div>
  );
}

export default App;
